import React from "react";
import { Carousel } from "react-bootstrap";
import img1 from "../../img/1.jpg";
import img8 from "../../img/8.jpg";
import img3 from "../../img/3.jpg";
import imgCategories1 from "../../img/categories/1.jpg";
import imgCategories2 from "../../img/categories/2.jpg";
import imgCategories3 from "../../img/categories/3.jpg";
import imgCategories4 from "../../img/categories/4.jpg";
import "./HomePage.css";

function HomePage() {
  return (
    <div className="mainBody">
      <Carousel id="carouselMainPageIndicators" className="mt-4">
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={img1}
            alt="First slide"
            height="1000px"
          />
          <Carousel.Caption className="text-center">
            <h1 className="display-4">
              <b>Saya Bento Cakes</b>
            </h1>
            <a href="menu.html" className="btn btn-primary btn-lg mt-3">
              Menu
            </a>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={img8}
            alt="Second slide"
            height="1000px"
          />
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={img3}
            alt="Third slide"
            height="1000px"
          />
          <Carousel.Caption className="text-center"></Carousel.Caption>
        </Carousel.Item>
      </Carousel>

      <div className="popular-items mt-5">
        <div className="container-fluid">
          {/* ... (your existing code for popular items) */}
        </div>
      </div>

      <hr className="m-3 bg-dark"></hr>
      {/* Include Bootstrap scripts here if not already included */}
    </div>
  );
}

export default HomePage;
